        for (int i = 0; i < s_steps; i++)
        {
            for (int j = 0; j < s_steps; j++)
            {
                var result = _samplePositions[j * s_steps + i];
                result.y = _resultHeights[j * s_steps + i];

                DebugDrawCross(result, 1f, Color.green);
            }
        }
    }
}
